{'id': 32794017, 'body': 'VPBank cảm ơn Quý khách đã quan tâm và góp ý cho dịch vụ VPBank. Quý khách vui lòng cập nhật các chương trình ưu đãi và khuyến mại của VPBank tại trang web chính thức theo link: https://www.vpbank.com.vn/uu-dai
Các nội dung không được đăng tải chính thức bởi VPBank Quý khách vui lòng cảnh giác lừa đảo và rủi ro mất tiền, xin cám ơn!

', 'modified': '2022-10-26T09:14:12Z'}

{'id': 32572288, 'body': 'VPBank rất xin lỗi Quý khách vì sự bất tiện này, QK vui lòng gỡ app và tải lại phiên bản mới nhất sau đó thử khởi động lại điện thoại.

Ngoài ra, nếu gần đây Quý khách có cài đặt phần mềm VPN, tường lửa proxy… cũng có thể là nguyên nhân dẫn đến không kết nối được VPBank NEO. Quý khách vui lòng gỡ các ứng dụng này để thực hiện lại đăng nhập VPBank NEO. 
Trường hợp vẫn gặp lỗi vui lòng gửi kèm hình ảnh lỗi đến chamsockhachhang@vpbank.com.vn để được hỗ trợ xử lý!', 'modified': '2022-10-14T09:10:57Z'}

{'id': 32436245, 'body': 'VPBank xin gửi lời xin lỗi vì trải nghiệm chưa tốt của Quý khách khi kết nối với VPBank. Chúng tôi xin phép ghi nhận góp ý và chấn chỉnh NV hỗ trợ theo quy định về tiêu chuẩn chất lượng dịch vụ của VPBank. 
Nếu cần hỗ trợ thêm liên qua đến SP/ DV Quý khách vui lòng gửi yêu cầu đến email chamsockhachhang@vpbank.com.vn và kèm hình ảnh lỗi (nếu có). 


Xin chân thành cám ơn Quý khách vì sự đóng góp ý kiến để VPBank ngày càng hoàn thiện hơn về chất lượng dịch vụ. Một lần nữa chúng tôi rất mong Quý khách thông cảm và tiếp tục gắn bó cùng VPBank trong thời gian tới.', 'modified': '2022-10-07T07:11:36Z'}

{'id': 31155901, 'body': '

VPBank rất xin lỗi Quý Khách vì sự bất tiện này, hiện tại hệ thống đã hoạt động ổn định trở lại. Quý Khách vui lòng cập nhật phiên bản mới nhất của VPBank NEO để trải nghiệm tốt nhất, xin cám ơn!
', 'modified': '2022-07-29T03:28:45Z'}

{'id': 30509715, 'body': '
VPBank rất xin lỗi vì sự bất tiện Quý Khách đang gặp phải. Thẻ ghi nợ được liên kết với tài khoản thanh toán của Quý khách mở tại VPBank, có chức năng rút tiền ATM, thanh toán chi tiêu online hoặc quẹt thẻ. Cần tư vấn thông tin chi tiết hơn, Quý khách vui lòng tạo yêu cầu chi tiết tại https://cskh.vpbank.com.vn/#SupportQuestion/CreateTicket. Ngay sau khi nhận được yêu cầu VPBank sẽ gấp rút kiểm tra và phản hồi. Cảm ơn Quý khách!

', 'modified': '2022-06-23T01:48:36Z'}

{'id': 29393174, 'body': 'VPBank rất xin lỗi Quý khách vì sự bất tiện này! Trường hợp Quý khách không có thẻ tại VPBank, vui lòng sử dụng số điện thoại đã đăng ký với VPBank để liên hệ tổng đài 1900545415 (Khách hàng tiêu chuẩn) hoặc 1800545415 (Khách hàng ưu tiên).

-         Bước 1: Chọn nhánh 1 Khách hàng cá nhân - Chọn tiếp nhánh 4 để được hỗ trợ về Ngân hàng số.

-         Bước 2: Chọn phím 5 gặp tổng đài viên để được hỗ trợ cấp lại mật khẩu', 'modified': '2022-04-26T03:58:36Z'}

{'id': 29922944, 'body': 'VPBank cảm ơn Quý khách đã quan tâm và góp ý cho SP/DV. Sao kê thẻ tín dụng hàng tháng đều được gửi về email Quý khách đăng ký, trong trường hợp không nhận được, Quý khách vui lòng đăng nhập ứng dụng VPBank NEO gửi gưi lại sao kê như sau:

Thẻ -> chọn số thẻ cần xuất sao kê -> Quản lý -> Gửi sao kê

Chọn kỳ sao kê (có thể chọn 3 tháng gần nhất) -> Gửi sao kê', 'modified': '2022-05-24T02:30:40Z'}
